import { useEffect, useState } from 'react';
import { webHeader } from '../utils/data';
import '../styles/Components/navbar.css';
import { useNavigate } from 'react-router-dom';
import { faCaretDown, faCaretSquareLeft } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { Signup } from './signup';

export function Navbar1(props: { navItems: { Icon: JSX.Element, title: string, url: string }[] }) {
    return (
        <div className="Navbar1">
            <div className="allItems1">
                <ul className="pagesItemsUl1">
                    {props.navItems.map((curr, i) => (
                        <li key={i}> <a href={curr.url}> {curr.Icon}  {curr.title} </a></li>
                    ))}
                </ul>
            </div>
        </div>





    );
}

export function togglePopup() {
    const [isOpen, setIsOpen] = useState(false);
    setIsOpen(!isOpen);
    return (
        isOpen
    )
}


export function Navbar2(props: { navItems: { title: string, url: string }[] }) {

    useEffect(() => {
        (document.querySelector('.headerOfWeb') as HTMLElement).innerHTML = webHeader.innerHTML
    }, []);


    const [isOpen, setIsOpen] = useState(false);




    return (
        <div className="Navbar2">
            <div className="allItems2">
                <div className='headerOfWeb'>
                    <h1> speak your heart out </h1>
                </div>

                <ul className="pagesItemsUl2">
                    {props.navItems.map((curr, i) => (
                        <li key={i}>  <input
                            type="button"
                            value={curr.title}
                            onClick={togglePopup}
                        /> </li>
                    ))}

                </ul>


            </div>

        </div >

    )

}


export function AskNav(props: { navItems: { title: string, url: string, options: { title: string, url: string }[] }[] }) {
    const navigate = useNavigate()
    return (
        <div className="askNavDiv">
            <div className="allItems">

                <ul className="Ulnames">
                    {props.navItems.map((curr1, i) => (
                        <li id='myLi' key={i}> {curr1.title} <FontAwesomeIcon icon={faCaretDown}></FontAwesomeIcon><ul className='optionUl'>
                            {curr1.options.map((curr2, z) => (
                                <li key={z}>
                                    <div className='url' data-url={'/Ask/' + curr2.url}
                                        onClick={() => { navigate('/Ask/' + curr2.url) }} >
                                        {curr2.title}
                                    </div>
                                </li>
                            ))}
                        </ul>
                        </li>
                    ))}

                </ul>
            </div>

        </div>
    )
}
